import React, { useState } from "react";
import "./InfiniteCanvas.css";

// Full screen grid of cards with proper SVG thumbnails
const cards = [
  { id: 1, img: "/assets/thumbnails/mathematics.svg", title: "Mathematics" },
  { id: 2, img: "/assets/thumbnails/programming.svg", title: "Programming" },
  { id: 3, img: "/assets/thumbnails/languages.svg", title: "Languages" },
  { id: 4, img: "/assets/thumbnails/history.svg", title: "History" },
  { id: 5, img: "/assets/thumbnails/quantum-mechanics.svg", title: "Quantum Mechanics" },
  { id: 6, img: "/assets/thumbnails/chemistry.svg", title: "Chemistry" },
  { id: 7, img: "/assets/thumbnails/geometry.svg", title: "Geometry" },
  { id: 8, img: "/assets/thumbnails/music.svg", title: "Music" },
  { id: 9, img: "/assets/thumbnails/astronomy.svg", title: "Astronomy" },
  { id: 10, img: "/assets/thumbnails/finance.svg", title: "Finance" },
  { id: 11, img: "/assets/thumbnails/technology.svg", title: "Technology" },
  { id: 12, img: "/assets/thumbnails/health.svg", title: "Health" },
  { id: 13, img: "/assets/thumbnails/sports.svg", title: "Sports" },
  { id: 14, img: "/assets/thumbnails/art.svg", title: "Art" },
  { id: 15, img: "/assets/thumbnails/design.svg", title: "Design" },
  { id: 16, img: "/assets/thumbnails/business.svg", title: "Business" },
  { id: 17, img: "/assets/thumbnails/psychology.svg", title: "Psychology" },
  { id: 18, img: "/assets/thumbnails/social.svg", title: "Social" },
  { id: 19, img: "/assets/thumbnails/cooking.svg", title: "Cooking" },
  { id: 20, img: "/assets/thumbnails/travel.svg", title: "Travel" },
  // Duplicate some cards to fill more space
  { id: 21, img: "/assets/thumbnails/mathematics.svg", title: "Advanced Math" },
  { id: 22, img: "/assets/thumbnails/programming.svg", title: "Web Development" },
  { id: 23, img: "/assets/thumbnails/languages.svg", title: "Linguistics" },
  { id: 24, img: "/assets/thumbnails/history.svg", title: "World History" },
  { id: 25, img: "/assets/thumbnails/finance.svg", title: "Investment" },
  { id: 26, img: "/assets/thumbnails/technology.svg", title: "AI & ML" },
  { id: 27, img: "/assets/thumbnails/health.svg", title: "Wellness" },
  { id: 28, img: "/assets/thumbnails/sports.svg", title: "Fitness" },
  { id: 29, img: "/assets/thumbnails/art.svg", title: "Digital Art" },
  { id: 30, img: "/assets/thumbnails/design.svg", title: "UX Design" },
  { id: 31, img: "/assets/thumbnails/business.svg", title: "Entrepreneurship" },
  { id: 32, img: "/assets/thumbnails/psychology.svg", title: "Cognitive Science" },
  { id: 33, img: "/assets/thumbnails/social.svg", title: "Communication" },
  { id: 34, img: "/assets/thumbnails/cooking.svg", title: "Baking" },
  { id: 35, img: "/assets/thumbnails/travel.svg", title: "Adventure" },
  { id: 36, img: "/assets/thumbnails/chemistry.svg", title: "Biochemistry" },
  { id: 37, img: "/assets/thumbnails/geometry.svg", title: "3D Modeling" },
  { id: 38, img: "/assets/thumbnails/music.svg", title: "Music Theory" },
  { id: 39, img: "/assets/thumbnails/astronomy.svg", title: "Astrophysics" },
  { id: 40, img: "/assets/thumbnails/quantum-mechanics.svg", title: "Quantum Computing" },
];

export default function InfiniteCanvas() {
  const [offset, setOffset] = useState({ x: 0, y: 0 });
  const [dragging, setDragging] = useState(false);
  const [start, setStart] = useState({ x: 0, y: 0 });

  function onMouseDown(e: React.MouseEvent) {
    setDragging(true);
    setStart({ x: e.clientX - offset.x, y: e.clientY - offset.y });
  }
  function onMouseMove(e: React.MouseEvent) {
    if (!dragging) return;
    setOffset({ x: e.clientX - start.x, y: e.clientY - start.y });
  }
  function onMouseUp() {
    setDragging(false);
  }

  return (
    <div
      className="InfiniteCanvas"
      onMouseDown={onMouseDown}
      onMouseMove={onMouseMove}
      onMouseUp={onMouseUp}
    >
      <div
        className="CardGrid"
        style={{ transform: `translate(${offset.x}px, ${offset.y}px)` }}
      >
        {cards.map((c) => (
          <div key={c.id} className="DeckCard">
            <img src={c.img} alt={c.title} />
            <div className="title">{c.title}</div>
          </div>
        ))}
      </div>
    </div>
  );
}
